import socket

def scan_external_host(ip, port_list=[22, 80, 443]):
    print(f"[*]   : {ip}")
    open_ports = []
    for port in port_list:
        try:
            sock = socket.create_connection((ip, port), timeout=3)
            open_ports.append(port)
            sock.close()
        except:
            pass
    if open_ports:
        print(f"[+]    {ip}: {', '.join(map(str, open_ports))}")
    else:
        print(f"[-]  {ip}   .")
    return open_ports
